import React from 'react';

function Doc(props) {

  const searchFocDoc = () => {
    if (props.source == null) {
      return "nobueno.jpg";
    }
    return URL.createObjectURL(props.source)
  }
  return (
    <div className="docs_col">
      <p>{props.name}</p>
      <img src={searchFocDoc} className="image" id={props.source.name} alt="picture storage not setup"/>
    </div>
  );
};

export default Doc;
